  const email = useRef<string>("");
  const password = useRef<string>("");

  return <Modal show={true}>
    <Card>
      <Form>
        <Form.Group>
          <Form.Label> Correo </Form.Label>
          <Form.Control type="email" ref={(ref: React.MutableRefObject<string>) => {email.current = ref}} required></Form.Control>
          <Form.Label> Contrase√±a </Form.Label>
          <Form.Control type="password" ref={(ref: React.MutableRefObject<string>) => {password.current = ref}} required></Form.Control>
        </Form.Group>
        <Button type="submit">Iniciar Sesion</Button>
      </Form>
    </Card>
  </Modal>
}

export default Login;
